import readline from "readline/promises";
import { stdin as input, stdout as output } from "process";
import fs from "fs";


// Extract unique themes and sort
const themes = [...new Set(data.map(item => item.theme))].sort();

// Show menu
console.log("Escolha um tema:");
themes.forEach((theme, index) => {
    console.log(`${index + 1}) ${theme}`);
});

// Setup readline
const rl = readline.createInterface({ input, output });

async function main() {
    const inputChoice = await rl.question("\nDigite o número do tema desejado: ");
    const choice = parseInt(inputChoice) - 1;

    if (choice >= 0 && choice < themes.length) {
        const selectedTheme = themes[choice];
        const filtered = data.filter(item => item.theme === selectedTheme);

        // Serialize compact JSON
        const compactJson = JSON.stringify(filtered);

        // Sanitize filename (remove invalid chars)
        const filename = selectedTheme.replace(/[\/\\?%*:|"<>]/g, "_") + ".json";

        // Write to file
        fs.writeFileSync(filename, compactJson);
        console.log(`\nArquivo criado: ${filename}`);
    } else {
        console.log("Opção inválida.");
    }

    rl.close();
}

main();
